arasuperobject.biblemap.put("b58_6_16", new arasuperobject(58,6,16,"فان الناس يقسمون بالاعظم ونهاية كل مشاجرة عندهم لاجل التثبيت هي القسم"));
arasuperobject.biblemap.put("b58_6_17", new arasuperobject(58,6,17,"فلذلك اذ اراد الله ان يظهر اكثر كثيرا لورثة الموعد عدم تغيّر قضائه توسط بقسم"));
arasuperobject.biblemap.put("b58_6_18", new arasuperobject(58,6,18,"حتى بامرين عديمي التغير لا يمكن ان الله يكذب فيهما تكون لنا تعزية قوية نحن الذين التجأنا لنمسك بالرجاء الموضوع امامنا"));
arasuperobject.biblemap.put("b58_6_19", new arasuperobject(58,6,19,"الذي هو لنا كمرساة للنفس مؤتمنة وثابتة تدخل الى ما داخل الحجاب"));
arasuperobject.biblemap.put("b58_6_20", new arasuperobject(58,6,20,"حيث دخل يسوع كسابق لاجلنا صائرا على رتبة ملكي صادق رئيس كهنة الى الابد"));
arasuperobject.biblemap.put("b58_7_1", new arasuperobject(58,7,1,"لان ملكي صادق هذا ملك ساليم كاهن الله العلي الذي استقبل ابراهيم راجعا من كسرة الملوك وباركه"));
arasuperobject.biblemap.put("b58_7_2", new arasuperobject(58,7,2,"الذي قسم له ابراهيم عشرا من كل شيء. المترجم اولا ملك البر ثم ايضا ملك ساليم اي ملك السلام"));
arasuperobject.biblemap.put("b58_7_3", new arasuperobject(58,7,3,"بلا اب بلا ام بلا نسب. لا بداءة ايام له ولا نهاية حياة بل هو مشبه بابن الله هذا يبقى كاهنا الى الابد"));
arasuperobject.biblemap.put("b58_7_4", new arasuperobject(58,7,4,"ثم انظروا ما اعظم هذا الذي اعطاه ابراهيم رئيس الآباء عشرا ايضا من راس الغنائم"));
arasuperobject.biblemap.put("b58_7_5", new arasuperobject(58,7,5,"واما الذين هم من بني لاوي الذين يأخذون الكهنوت فلهم وصية ان يعشروا الشعب بمقتضى الناموس اي اخوتهم مع انهم قد خرجوا من صلب ابراهيم"));
arasuperobject.biblemap.put("b58_7_6", new arasuperobject(58,7,6,"ولكن الذي ليس له نسب منهم قد عشّر ابراهيم وبارك الذي له المواعيد"));
arasuperobject.biblemap.put("b58_7_7", new arasuperobject(58,7,7,"وبدون كل مشاجرة الاصغر يبارك من الاكبر"));
arasuperobject.biblemap.put("b58_7_8", new arasuperobject(58,7,8,"وهنا اناس مائتون يأخذون عشرا واما هناك فالمشهود له بانه حيّ"));
arasuperobject.biblemap.put("b58_7_9", new arasuperobject(58,7,9,"حتى اقول كلمة ان لاوي ايضا الآخذ الاعشار قد عشّر بابراهيم"));
arasuperobject.biblemap.put("b58_7_10", new arasuperobject(58,7,10,"لانه كان بعد في صلب ابيه حين استقبله ملكي صادق"));
arasuperobject.biblemap.put("b58_7_11", new arasuperobject(58,7,11,"فلو كان بالكهنوت اللاوي كمال. اذ الشعب اخذ الناموس عليه. ماذا كانت الحاجة بعد الى ان يقوم كاهن آخر على رتبة ملكي صادق ولا يقال على رتبة هرون"));
arasuperobject.biblemap.put("b58_7_12", new arasuperobject(58,7,12,"لانه ان تغيّر الكهنوت فبالضرورة يصير تغيّر للناموس ايضا"));
arasuperobject.biblemap.put("b58_7_13", new arasuperobject(58,7,13,"لان الذي يقال عنه هذا كان شريكا في سبط آخر لم يلازم احد منه المذبح"));
arasuperobject.biblemap.put("b58_7_14", new arasuperobject(58,7,14,"فانه واضح ان ربنا قد طلع من سبط يهوذا الذي لم يتكلم عنه موسى شيئا من جهة الكهنوت"));
arasuperobject.biblemap.put("b58_7_15", new arasuperobject(58,7,15,"وذلك اكثر وضوحا ايضا ان كان على شبه ملكي صادق يقوم كاهن آخر"));
arasuperobject.biblemap.put("b58_7_16", new arasuperobject(58,7,16,"قد صار ليس بحسب ناموس وصية جسدية بل بحسب قوة حياة لا تزول"));
arasuperobject.biblemap.put("b58_7_17", new arasuperobject(58,7,17,"لانه يشهد انك كاهن الى الابد على رتبة ملكي صادق"));
arasuperobject.biblemap.put("b58_7_18", new arasuperobject(58,7,18,"فانه يصير ابطال الوصية السابقة من اجل ضعفها وعدم نفعها"));
arasuperobject.biblemap.put("b58_7_19", new arasuperobject(58,7,19,"اذ الناموس لم يكمل شيئا. ولكن يصير ادخال رجاء افضل به نقترب الى الله"));
arasuperobject.biblemap.put("b58_7_20", new arasuperobject(58,7,20,"وعلى قدر ما انه ليس بدون قسم"));
arasuperobject.biblemap.put("b58_7_21", new arasuperobject(58,7,21,"لان اولئك بدون قسم قد صاروا كهنة واما هذا فبقسم من القائل له اقسم الرب ولن يندم انت كاهن الى الابد على رتبة ملكي صادق"));
arasuperobject.biblemap.put("b58_7_22", new arasuperobject(58,7,22,"على قدر ذلك قد صار يسوع ضامنا لعهد افضل"));
arasuperobject.biblemap.put("b58_7_23", new arasuperobject(58,7,23,"واولئك قد صاروا كهنة كثيرين من اجل منعهم بالموت عن البقاء"));
arasuperobject.biblemap.put("b58_7_24", new arasuperobject(58,7,24,"واما هذا فمن اجل انه يبقى الى الابد له كهنوت لا يزول"));
arasuperobject.biblemap.put("b58_7_25", new arasuperobject(58,7,25,"فمن ثم يقدر ان يخلّص ايضا الى التمام الذين يتقدمون به الى الله اذ هو حيّ في كل حين ليشفع فيهم"));
arasuperobject.biblemap.put("b58_7_26", new arasuperobject(58,7,26,"لانه كان يليق بنا رئيس كهنة مثل هذا قدوس بلا شر ولا دنس قد انفصل عن الخطاة وصار اعلى من السموات"));
arasuperobject.biblemap.put("b58_7_27", new arasuperobject(58,7,27,"الذي ليس له اضطرار كل يوم مثل رؤساء الكهنة ان يقدم ذبائح اولا عن خطايا نفسه ثم عن خطايا الشعب لانه فعل هذا مرة واحدة اذ قدم نفسه"));
arasuperobject.biblemap.put("b58_7_28", new arasuperobject(58,7,28,"فان الناموس يقيم اناسا بهم ضعف رؤساء كهنة واما كلمة القسم التي بعد الناموس فتقيم ابنا مكملا الى الابد"));
arasuperobject.biblemap.put("b58_8_1", new arasuperobject(58,8,1,"واما راس الكلام فهو ان لنا رئيس كهنة مثل هذا قد جلس في يمين عرش العظمة في السموات"));
arasuperobject.biblemap.put("b58_8_2", new arasuperobject(58,8,2,"خادما للاقداس والمسكن الحقيقي الذي نصبه الرب لا انسان"));
arasuperobject.biblemap.put("b58_8_3", new arasuperobject(58,8,3,"لان كل رئيس كهنة يقام لكي يقدم قرابين وذبائح. فمن ثم يلزم ان يكون لهذا ايضا شيء يقدمه"));
arasuperobject.biblemap.put("b58_8_4", new arasuperobject(58,8,4,"فانه لو كان على الارض لما كان كاهنا اذ يوجد الكهنة الذين يقدمون قرابين حسب الناموس"));
arasuperobject.biblemap.put("b58_8_5", new arasuperobject(58,8,5,"الذين يخدمون شبه السماويات وظلها كما اوحي الى موسى وهو مزمع ان يصنع المسكن. لانه قال انظر ان تصنع كل شيء حسب المثال الذي اظهر لك في الجبل"));
arasuperobject.biblemap.put("b58_8_6", new arasuperobject(58,8,6,"ولكنه الآن قد حصل على خدمة افضل بمقدار ما هو وسيط ايضا لعهد اعظم قد تثبّت على مواعيد افضل"));
arasuperobject.biblemap.put("b58_8_7", new arasuperobject(58,8,7,"فانه لو كان ذلك الاول بلا عيب لما طلب موضع لثان"));
arasuperobject.biblemap.put("b58_8_8", new arasuperobject(58,8,8,"لانه يقول لهم لائما هوذا ايام تأتي يقول الرب حين اكمّل مع بيت اسرائيل ومع بيت يهوذا عهدا جديدا"));
arasuperobject.biblemap.put("b58_8_9", new arasuperobject(58,8,9,"لا كالعهد الذي عملته مع آبائهم يوم امسكت بيدهم لاخرجهم من ارض مصر لانهم لم يثبتوا في عهدي وانا اهملتهم يقول الرب"));
arasuperobject.biblemap.put("b58_8_10", new arasuperobject(58,8,10,"لان هذا هو العهد الذي اعهده مع بيت اسرائيل بعد تلك الايام يقول الرب اجعل نواميسي في اذهانهم واكتبها على قلوبهم وانا اكون لهم الها وهم يكونون لي شعبا"));
arasuperobject.biblemap.put("b58_8_11", new arasuperobject(58,8,11,"ولا يعلّمون كل واحد قريبه وكل واحد اخاه قائلا اعرف الرب لان الجميع سيعرفونني من صغيرهم الى كبيرهم"));
arasuperobject.biblemap.put("b58_8_12", new arasuperobject(58,8,12,"لاني اكون صفوحا عن آثامهم ولا اذكر خطاياهم وتعدياتهم في ما بعد"));
arasuperobject.biblemap.put("b58_8_13", new arasuperobject(58,8,13,"فاذ قال جديدا عتق الاول. واما ما عتّق وشاخ فهو قريب من الاضمحلال"));
arasuperobject.biblemap.put("b58_9_1", new arasuperobject(58,9,1,"ثم العهد الاول كان له فرائض خدمة والقدس العالمي"));
arasuperobject.biblemap.put("b58_9_2", new arasuperobject(58,9,2,"لانه نصب المسكن الاول الذي يقال له القدس الذي كان فيه المنارة والمائدة وخبز التقدمة"));
arasuperobject.biblemap.put("b58_9_3", new arasuperobject(58,9,3,"ووراء الحجاب الثاني المسكن الذي يقال له قدس الاقداس"));
arasuperobject.biblemap.put("b58_9_4", new arasuperobject(58,9,4,"فيه مبخرة من ذهب وتابوت العهد مغشّى من كل جهة بالذهب الذي فيه قسط من ذهب فيه المنّ وعصا هرون التي افرخت ولوحا العهد"));
arasuperobject.biblemap.put("b58_9_5", new arasuperobject(58,9,5,"وفوقه كروبا المجد مظللين الغطاء. اشياء ليس لنا الآن ان نتكلم عنها بالتفصيل"));
arasuperobject.biblemap.put("b58_9_6", new arasuperobject(58,9,6,"ثم اذ صارت هذه مهيأة هكذا يدخل الكهنة الى المسكن الاول كل حين صانعين الخدمة"));
arasuperobject.biblemap.put("b58_9_7", new arasuperobject(58,9,7,"واما الى الثاني فرئيس الكهنة فقط مرة في السنة ليس بلا دم يقدمه عن نفسه وعن جهالات الشعب"));
arasuperobject.biblemap.put("b58_9_8", new arasuperobject(58,9,8,"معلنا الروح القدس بهذا ان طريق الاقداس لم يظهر بعد ما دام المسكن الاول له اقامة"));
arasuperobject.biblemap.put("b58_9_9", new arasuperobject(58,9,9,"الذي هو رمز للوقت الحاضر الذي فيه تقدم قرابين وذبائح لا يمكن من جهة الضمير ان تكمّل الذي يخدم"));
arasuperobject.biblemap.put("b58_9_10", new arasuperobject(58,9,10,"وهي قائمة باطعمة واشربة وغسلات مختلفة وفرائض جسدية فقط موضوعة الى وقت الاصلاح"));
arasuperobject.biblemap.put("b58_9_11", new arasuperobject(58,9,11,"واما المسيح وهو قد جاء رئيس كهنة للخيرات العتيدة فبالمسكن الاعظم والاكمل غير المصنوع بيد اي الذي ليس من هذه الخليقة"));
arasuperobject.biblemap.put("b58_9_12", new arasuperobject(58,9,12,"وليس بدم تيوس وعجول بل بدم نفسه دخل مرة واحدة الى الاقداس فوجد فداء ابديا"));
arasuperobject.biblemap.put("b58_9_13", new arasuperobject(58,9,13,"لانه ان كان دم ثيران وتيوس ورماد عجلة مرشوش على المنجسين يقدس الى طهارة الجسد"));
arasuperobject.biblemap.put("b58_9_14", new arasuperobject(58,9,14,"فكم بالحري يكون دم المسيح الذي بروح ازلي قدم نفسه للّه بلا عيب يطهر ضمائركم من اعمال ميتة لتخدموا الله الحي"));
arasuperobject.biblemap.put("b58_9_15", new arasuperobject(58,9,15,"ولاجل هذا هو وسيط عهد جديد لكي يكون المدعوون اذ صار موت لفداء التعديات التي في العهد الاول ينالون وعد الميراث الابدي"));
arasuperobject.biblemap.put("b58_9_16", new arasuperobject(58,9,16,"لانه حيث توجد وصية يلزم بيان موت الموصي"));
arasuperobject.biblemap.put("b58_9_17", new arasuperobject(58,9,17,"لان الوصية ثابتة على الموتى اذ لا قوة لها البتة ما دام الموصي حيا"));
arasuperobject.biblemap.put("b58_9_18", new arasuperobject(58,9,18,"فمن ثم الاول ايضا لم يكرس بلا دم"));
arasuperobject.biblemap.put("b58_9_19", new arasuperobject(58,9,19,"لان موسى بعدما كلم جميع الشعب بكل وصية بحسب الناموس اخذ دم العجول والتيوس مع ماء وصوفا قرمزيا وزوفا ورشّ الكتاب نفسه وجميع الشعب"));
arasuperobject.biblemap.put("b58_9_20", new arasuperobject(58,9,20,"قائلا هذا هو دم العهد الذي اوصاكم الله به"));
arasuperobject.biblemap.put("b58_9_21", new arasuperobject(58,9,21,"والمسكن ايضا وجميع آنية الخدمة رشها كذلك بالدم"));
arasuperobject.biblemap.put("b58_9_22", new arasuperobject(58,9,22,"وكل شيء تقريبا يتطهر حسب الناموس بالدم وبدون سفك دم لا تحصل مغفرة"));
arasuperobject.biblemap.put("b58_9_23", new arasuperobject(58,9,23,"فكان يلزم ان امثلة الاشياء التي في السموات تطهر بهذه واما السماويات عينها فبذبائح افضل من هذه"));
arasuperobject.biblemap.put("b58_9_24", new arasuperobject(58,9,24,"لان المسيح لم يدخل الى اقداس مصنوعة بيد اشباه الحقيقية بل الى السماء عينها ليظهر الآن امام وجه الله لاجلنا"));
arasuperobject.biblemap.put("b58_9_25", new arasuperobject(58,9,25,"ولا ليقدم نفسه مرارا كثيرة كما يدخل رئيس الكهنة الى الاقداس كل سنة بدم آخر"));
arasuperobject.biblemap.put("b58_9_26", new arasuperobject(58,9,26,"فاذ ذاك كان يجب ان يتألم مرارا كثيرة منذ تأسيس العالم ولكنه الآن قد اظهر مرة عند انقضاء الدهور ليبطل الخطية بذبيحة نفسه"));
arasuperobject.biblemap.put("b58_9_27", new arasuperobject(58,9,27,"وكما وضع للناس ان يموتوا مرة ثم بعد ذلك الدينونة"));
arasuperobject.biblemap.put("b58_9_28", new arasuperobject(58,9,28,"هكذا المسيح ايضا بعدما قدّم مرة لكي يحمل خطايا كثيرين سيظهر ثانية بلا خطية للخلاص للذين ينتظرونه"));
arasuperobject.biblemap.put("b58_10_1", new arasuperobject(58,10,1,"لان الناموس اذ له ظل الخيرات العتيدة لا نفس صورة الاشياء لا يقدر ابدا بنفس الذبائح كل سنة التي يقدمونها على الدوام ان يكمّل الذين يتقدمون"));
arasuperobject.biblemap.put("b58_10_2", new arasuperobject(58,10,2,"وإلا أفما زالت تقدم. من اجل ان الخادمين وهم مطهرون مرة لا يكون لهم ايضا ضمير خطايا"));
arasuperobject.biblemap.put("b58_10_3", new arasuperobject(58,10,3,"لكن فيها كل سنة ذكر خطايا"));
arasuperobject.biblemap.put("b58_10_4", new arasuperobject(58,10,4,"لانه لا يمكن ان دم ثيران وتيوس يرفع خطايا"));
arasuperobject.biblemap.put("b58_10_5", new arasuperobject(58,10,5,"لذلك عند دخوله الى العالم يقول ذبيحة وقربانا لم ترد ولكن هيأت لي جسدا"));
arasuperobject.biblemap.put("b58_10_6", new arasuperobject(58,10,6,"بمحرقات وذبائح للخطية لم تسرّ"));
arasuperobject.biblemap.put("b58_10_7", new arasuperobject(58,10,7,"ثم قلت هانذا اجيء في درج الكتاب مكتوب عني لافعل مشيئتك يا الله"));
arasuperobject.biblemap.put("b58_10_8", new arasuperobject(58,10,8,"اذ يقول آنفا انك ذبيحة وقربانا ومحرقات وذبائح للخطية لم ترد ولا سررت بها. التي تقدّم حسب الناموس"));
arasuperobject.biblemap.put("b58_10_9", new arasuperobject(58,10,9,"ثم قال هانذا اجيء لافعل مشيئتك يا الله. ينزع الاول لكي يثبت الثاني"));
arasuperobject.biblemap.put("b58_10_10", new arasuperobject(58,10,10,"فبهذه المشيئة نحن مقدّسون بتقديم جسد يسوع المسيح مرة واحدة"));
arasuperobject.biblemap.put("b58_10_11", new arasuperobject(58,10,11,"وكل كاهن يقوم كل يوم يخدم ويقدّم مرارا كثيرة تلك الذبائح عينها التي لا تستطيع البتة ان تنزع الخطية"));
arasuperobject.biblemap.put("b58_10_12", new arasuperobject(58,10,12,"واما هذا فبعدما قدّم عن الخطايا ذبيحة واحدة جلس الى الابد عن يمين الله"));
arasuperobject.biblemap.put("b58_10_13", new arasuperobject(58,10,13,"منتظرا بعد ذلك حتى توضع اعداؤه موطئا لقدميه"));
arasuperobject.biblemap.put("b58_10_14", new arasuperobject(58,10,14,"لانه بقربان واحد قد اكمل الى الابد المقدّسين"));
arasuperobject.biblemap.put("b58_10_15", new arasuperobject(58,10,15,"ويشهد لنا الروح القدس ايضا. لانه بعدما قال سابقا"));
arasuperobject.biblemap.put("b58_10_16", new arasuperobject(58,10,16,"هذا هو العهد الذي اعهده معهم بعد تلك الايام يقول الرب اجعل نواميسي في قلوبهم واكتبها في اذهانهم"));
arasuperobject.biblemap.put("b58_10_17", new arasuperobject(58,10,17,"ولن اذكر خطاياهم وتعدياتهم في ما بعد"));
arasuperobject.biblemap.put("b58_10_18", new arasuperobject(58,10,18,"وانما حيث تكون مغفرة لهذه لا يكون بعد قربان عن الخطية"));
arasuperobject.biblemap.put("b58_10_19", new arasuperobject(58,10,19,"فاذ لنا ايها الاخوة ثقة بالدخول الى الاقداس بدم يسوع"));
arasuperobject.biblemap.put("b58_10_20", new arasuperobject(58,10,20,"طريقا كرّسه لنا حديثا حيّا بالحجاب اي جسده"));
arasuperobject.biblemap.put("b58_10_21", new arasuperobject(58,10,21,"وكاهن عظيم على بيت الله"));
arasuperobject.biblemap.put("b58_10_22", new arasuperobject(58,10,22,"لنتقدم بقلب صادق في يقين الايمان مرشوشة قلوبنا من ضمير شرير ومغتسلة اجسادنا بماء نقي"));
arasuperobject.biblemap.put("b58_10_23", new arasuperobject(58,10,23,"لنتمسك باقرار الرجاء راسخا لان الذي وعد هو امين"));
arasuperobject.biblemap.put("b58_10_24", new arasuperobject(58,10,24,"ولنلاحظ بعضنا بعضا للتحريض على المحبة والاعمال الحسنة"));
arasuperobject.biblemap.put("b58_10_25", new arasuperobject(58,10,25,"غير تاركين اجتماعنا كما لقوم عادة بل واعظين بعضنا بعضا وبالاكثر على قدر ما ترون اليوم يقرب"));
arasuperobject.biblemap.put("b58_10_26", new arasuperobject(58,10,26,"فانه ان اخطأنا باختيارنا بعد ما اخذنا معرفة الحق لا تبقى بعد ذبيحة عن الخطايا"));
arasuperobject.biblemap.put("b58_10_27", new arasuperobject(58,10,27,"بل قبول دينونة مخيف وغيرة نار عتيدة ان تأكل المضادين"));
arasuperobject.biblemap.put("b58_10_28", new arasuperobject(58,10,28,"من خالف ناموس موسى فعلى شاهدين او ثلاثة شهود يموت بدون رأفة"));
arasuperobject.biblemap.put("b58_10_29", new arasuperobject(58,10,29,"فكم عقابا اشر تظنون انه يحسب مستحقا من داس ابن الله وحسب دم العهد الذي قدّس به دنسا وازدرى بروح النعمة"));
arasuperobject.biblemap.put("b58_10_30", new arasuperobject(58,10,30,"فاننا نعرف الذي قال لي الانتقام انا اجازي يقول الرب. وايضا الرب يدين شعبه"));
arasuperobject.biblemap.put("b58_10_31", new arasuperobject(58,10,31,"مخيف هو الوقوع في يدي الله الحي"));
arasuperobject.biblemap.put("b58_10_32", new arasuperobject(58,10,32,"ولكن تذكروا الايام السالفة التي فيها بعدما أنرتم صبرتم على مجاهدة آلام كثيرة"));
arasuperobject.biblemap.put("b58_10_33", new arasuperobject(58,10,33,"من جهة مشهورين بتعييرات وضيقات ومن جهة صائرين شركاء الذين تصرّف فيهم هكذا"));
arasuperobject.biblemap.put("b58_10_34", new arasuperobject(58,10,34,"لانكم رثيتم لقيودي ايضا وقبلتم سلب اموالكم بفرح عالمين في انفسكم ان لكم مالا افضل في السموات وباقيا"));
arasuperobject.biblemap.put("b58_10_35", new arasuperobject(58,10,35,"فلا تطرحوا ثقتكم التي لها مجازاة عظيمة"));
arasuperobject.biblemap.put("b58_10_36", new arasuperobject(58,10,36,"لانكم تحتاجون الى الصبر حتى اذا صنعتم مشيئة الله تنالون الموعد"));
arasuperobject.biblemap.put("b58_10_37", new arasuperobject(58,10,37,"لانه بعد قليل جدا سيأتي الآتي ولا يبطئ"));
arasuperobject.biblemap.put("b58_10_38", new arasuperobject(58,10,38,"اما البار فبالايمان يحيا وان ارتد لا تسرّ به نفسي"));
arasuperobject.biblemap.put("b58_10_39", new arasuperobject(58,10,39,"واما نحن فلسنا من الارتداد للهلاك بل من الايمان لاقتناء النفس"));
arasuperobject.biblemap.put("b58_11_1", new arasuperobject(58,11,1,"واما الايمان فهو الثقة بما يرجى والايقان بامور لا ترى"));
arasuperobject.biblemap.put("b58_11_2", new arasuperobject(58,11,2,"فانه في هذه شهد للقدماء"));
arasuperobject.biblemap.put("b58_11_3", new arasuperobject(58,11,3,"بالايمان نفهم ان العالمين أتقنت بكلمة الله حتى لم يتكون ما يرى مما هو ظاهر"));
arasuperobject.biblemap.put("b58_11_4", new arasuperobject(58,11,4,"بالايمان قدم هابيل للّه ذبيحة افضل من قايين. فبه شهد له انه بار اذ شهد الله لقرابينه. وبه وان مات يتكلم بعد"));
arasuperobject.biblemap.put("b58_11_5", new arasuperobject(58,11,5,"بالايمان نقل اخنوخ لكي لا يرى الموت ولم يوجد لان الله نقله. اذ قبل نقله شهد له بانه قد ارضى الله"));
arasuperobject.biblemap.put("b58_11_6", new arasuperobject(58,11,6,"ولكن بدون ايمان لا يمكن ارضاؤه لانه يجب ان الذي يأتي الى الله يؤمن بانه موجود وانه يجازي الذين يطلبونه"));
arasuperobject.biblemap.put("b58_11_7", new arasuperobject(58,11,7,"بالايمان نوح لما أوحي اليه عن امور لم ترى بعد خاف فبنى فلكا لخلاص بيته فبه دان العالم وصار وارثا للبر الذي حسب الايمان"));
arasuperobject.biblemap.put("b58_11_8", new arasuperobject(58,11,8,"بالايمان ابراهيم لما دعي اطاع ان يخرج الى المكان الذي كان عتيدا ان يأخذه ميراثا فخرج وهو لا يعلم الى اين يأتي"));
arasuperobject.biblemap.put("b58_11_9", new arasuperobject(58,11,9,"بالايمان تغرب في ارض الموعد كانها غريبة ساكنا في خيام مع اسحق ويعقوب الوارثين معه لهذا الموعد عينه"));
arasuperobject.biblemap.put("b58_11_10", new arasuperobject(58,11,10,"لانه كان ينتظر المدينة التي لها الاساسات التي صانعها وبارئها الله"));
arasuperobject.biblemap.put("b58_11_11", new arasuperobject(58,11,11,"بالايمان سارة نفسها ايضا اخذت قدرة على انشاء نسل وبعد وقت السن ولدت اذ حسبت الذي وعد صادقا"));
arasuperobject.biblemap.put("b58_11_12", new arasuperobject(58,11,12,"لذلك ولد ايضا من واحد وذلك من ممات مثل نجوم السماء في الكثرة وكالرمل الذي على شاطئ البحر الذي لا يعد"));
arasuperobject.biblemap.put("b58_11_13", new arasuperobject(58,11,13,"في الايمان مات هؤلاء اجمعون وهم لم ينالوا المواعيد بل من بعيد نظروها وصدقوها وحيوها واقروا بانهم غرباء ونزلاء على الارض"));
arasuperobject.biblemap.put("b58_11_14", new arasuperobject(58,11,14,"فان الذين يقولون مثل هذا يظهرون انهم يطلبون وطنا"));
arasuperobject.biblemap.put("b58_11_15", new arasuperobject(58,11,15,"فلو ذكروا ذلك الذي خرجوا منه لكان لهم فرصة للرجوع"));
arasuperobject.biblemap.put("b58_11_16", new arasuperobject(58,11,16,"ولكن الآن يبتغون وطنا افضل اي سماويا. لذلك لا يستحي بهم الله ان يدعى الههم لانه اعدّ لهم مدينة"));
arasuperobject.biblemap.put("b58_11_17", new arasuperobject(58,11,17,"بالايمان قدم ابراهيم اسحق وهو مجرب. قدم الذي قبل المواعيد وحيده"));
arasuperobject.biblemap.put("b58_11_18", new arasuperobject(58,11,18,"الذي قيل له انه باسحق يدعى لك نسل"));
arasuperobject.biblemap.put("b58_11_19", new arasuperobject(58,11,19,"اذ حسب ان الله قادر على الاقامة من الاموات ايضا الذين منهم اخذه ايضا في مثال"));
arasuperobject.biblemap.put("b58_11_20", new arasuperobject(58,11,20,"بالايمان اسحق بارك يعقوب وعيسو من جهة امور عتيدة"));
arasuperobject.biblemap.put("b58_11_21", new arasuperobject(58,11,21,"بالايمان يعقوب عند موته بارك كل واحد من ابني يوسف وسجد على راس عصاه"));
arasuperobject.biblemap.put("b58_11_22", new arasuperobject(58,11,22,"بالايمان يوسف عند موته ذكر خروج بني اسرائيل واوصى من جهة عظامه"));
arasuperobject.biblemap.put("b58_11_23", new arasuperobject(58,11,23,"بالايمان موسى بعد ما ولد اخفاه ابواه ثلاثة اشهر لانهما رأيا الصبي جميلا ولم يخشيا امر الملك"));
arasuperobject.biblemap.put("b58_11_24", new arasuperobject(58,11,24,"بالايمان موسى لما كبر ابى ان يدعى ابن ابنة فرعون"));
arasuperobject.biblemap.put("b58_11_25", new arasuperobject(58,11,25,"مفضلا بالاحرى ان يذل مع شعب الله على ان يكون له تمتع وقتي بالخطية"));
arasuperobject.biblemap.put("b58_11_26", new arasuperobject(58,11,26,"حاسبا عار المسيح غنى اعظم من خزائن مصر لانه كان ينظر الى المجازاة"));
arasuperobject.biblemap.put("b58_11_27", new arasuperobject(58,11,27,"بالايمان ترك مصر غير خائف من غضب الملك لانه تشدد كانه يرى من لا يرى"));
arasuperobject.biblemap.put("b58_11_28", new arasuperobject(58,11,28,"بالايمان صنع الفصح ورشّ الدم لئلا يمسهم الذي اهلك الابكار"));
arasuperobject.biblemap.put("b58_11_29", new arasuperobject(58,11,29,"بالايمان اجتازوا في البحر الاحمر كما في اليابسة الامر الذي لما شرع فيه المصريون غرقوا"));
arasuperobject.biblemap.put("b58_11_30", new arasuperobject(58,11,30,"بالايمان سقطت اسوار اريحا بعد ما طيف حولها سبعة ايام"));
arasuperobject.biblemap.put("b58_11_31", new arasuperobject(58,11,31,"بالايمان راحاب الزانية لم تهلك مع العصاة اذ قبلت الجاسوسين بسلام"));
arasuperobject.biblemap.put("b58_11_32", new arasuperobject(58,11,32,"وماذا اقول ايضا لانه يعوزني الوقت ان اخبرت عن جدعون وباراق وشمشون ويفتاح وداود وصموئيل والانبياء"));
arasuperobject.biblemap.put("b58_11_33", new arasuperobject(58,11,33,"الذين بالايمان قهروا ممالك صنعوا برا نالوا مواعيد سدوا افواه اسود"));
arasuperobject.biblemap.put("b58_11_34", new arasuperobject(58,11,34,"اطفأوا قوة النار نجوا من حد السيف تقووا من ضعف صاروا اشداء في الحرب هزموا جيوش غرباء"));
arasuperobject.biblemap.put("b58_11_35", new arasuperobject(58,11,35,"اخذت نساء امواتهن بقيامة. وآخرون عذبوا ولم يقبلوا النجاة لكي ينالوا قيامة افضل"));
arasuperobject.biblemap.put("b58_11_36", new arasuperobject(58,11,36,"وآخرون تجربوا في هزء وجلد ثم في قيود ايضا وحبس"));
arasuperobject.biblemap.put("b58_11_37", new arasuperobject(58,11,37,"رجموا نشروا جربوا ماتوا قتلا بالسيف طافوا في جلود غنم وجلود معزى معتازين مكروبين مذلين"));
arasuperobject.biblemap.put("b58_11_38", new arasuperobject(58,11,38,"وهم لم يكن العالم مستحقا لهم. تائهين في براري وجبال ومغاير وشقوق الارض"));
arasuperobject.biblemap.put("b58_11_39", new arasuperobject(58,11,39,"فهؤلاء كلهم مشهودا لهم بالايمان لم ينالوا الموعد"));
arasuperobject.biblemap.put("b58_11_40", new arasuperobject(58,11,40,"اذ سبق الله فنظر لنا شيئا افضل لكي لا يكملوا بدوننا"));
arasuperobject.biblemap.put("b58_12_1", new arasuperobject(58,12,1,"لذلك نحن ايضا اذ لنا سحابة من الشهود مقدار هذه محيطة بنا لنطرح كل ثقل والخطية المحيطة بنا بسهولة ولنحاضر بالصبر في الجهاد الموضوع امامنا"));
arasuperobject.biblemap.put("b58_12_2", new arasuperobject(58,12,2,"ناظرين الى رئيس الايمان ومكمله يسوع الذي من اجل السرور الموضوع امامه احتمل الصليب مستهينا بالخزي فجلس في يمين عرش الله"));
arasuperobject.biblemap.put("b58_12_3", new arasuperobject(58,12,3,"فتفكروا في الذي احتمل من الخطاة مقاومة لنفسه مثل هذه لئلا تكلوا وتخوروا في نفوسكم"));
arasuperobject.biblemap.put("b58_12_4", new arasuperobject(58,12,4,"لم تقاوموا بعد حتى الدم مجاهدين ضد الخطية"));
arasuperobject.biblemap.put("b58_12_5", new arasuperobject(58,12,5,"وقد نسيتم الوعظ الذي يخاطبكم كبنين يا ابني لا تحتقر تأديب الرب ولا تخر اذا وبخك"));
arasuperobject.biblemap.put("b58_12_6", new arasuperobject(58,12,6,"لان الذي يحبه الرب يؤدبه ويجلد كل ابن يقبله"));
arasuperobject.biblemap.put("b58_12_7", new arasuperobject(58,12,7,"ان كنتم تحتملون التأديب يعاملكم الله كالبنين. فاي ابن لا يؤدبه ابوه"));
arasuperobject.biblemap.put("b58_12_8", new arasuperobject(58,12,8,"ولكن ان كنتم بلا تأديب قد صار الجميع شركاء فيه فانتم نغول لا بنون"));
arasuperobject.biblemap.put("b58_12_9", new arasuperobject(58,12,9,"ثم قد كان لنا آباء اجسادنا مؤدبين وكنا نهابهم. أفلا نخضع بالأولى جدا لأبي الارواح فنحيا"));
arasuperobject.biblemap.put("b58_12_10", new arasuperobject(58,12,10,"لان اولئك أدبونا اياما قليلة حسب استحسانهم. واما هذا فلاجل المنفعة لكي نشترك في قداسته"));
arasuperobject.biblemap.put("b58_12_11", new arasuperobject(58,12,11,"ولكن كل تأديب في الحاضر لا يرى انه للفرح بل للحزن. واما اخيرا فيعطي الذين يتدربون به ثمر بر للسلام"));
arasuperobject.biblemap.put("b58_12_12", new arasuperobject(58,12,12,"لذلك قوّموا الايادي المسترخية والركب المخلّعة"));
arasuperobject.biblemap.put("b58_12_13", new arasuperobject(58,12,13,"واصنعوا لارجلكم مسالك مستقيمة لكي لا يعتسف الاعرج بل بالحري يشفى"));
arasuperobject.biblemap.put("b58_12_14", new arasuperobject(58,12,14,"اتبعوا السلام مع الجميع والقداسة التي بدونها لن يرى احد الرب"));
arasuperobject.biblemap.put("b58_12_15", new arasuperobject(58,12,15,"ملاحظين لئلا يخيب احد من نعمة الله. لئلا يطلع اصل مرارة ويصنع انزعاجا فيتنجس به كثيرون"));
arasuperobject.biblemap.put("b58_12_16", new arasuperobject(58,12,16,"لئلا يكون احد زانيا او مستبيحا كعيسو الذي لاجل اكلة واحدة باع بكوريته"));
arasuperobject.biblemap.put("b58_12_17", new arasuperobject(58,12,17,"فانكم تعلمون انه ايضا بعد ذلك لما اراد ان يرث البركة رفض اذ لم يجد للتوبة مكانا مع انه طلبها بدموع"));
arasuperobject.biblemap.put("b58_12_18", new arasuperobject(58,12,18,"لانكم لم تأتوا الى جبل ملموس مضطرم بالنار والى ضباب وظلام وزوبعة"));
arasuperobject.biblemap.put("b58_12_19", new arasuperobject(58,12,19,"وهتاف بوق وصوت كلمات استعفى الذين سمعوه من ان تزداد لهم كلمة"));
arasuperobject.biblemap.put("b58_12_20", new arasuperobject(58,12,20,"لانهم لم يحتملوا ما أمر به وان مست الجبل بهيمة ترجم او ترمى بسهم"));
arasuperobject.biblemap.put("b58_12_21", new arasuperobject(58,12,21,"وكان المنظر هكذا مخيفا حتى قال موسى انا مرتعب ومرتعد"));
arasuperobject.biblemap.put("b58_12_22", new arasuperobject(58,12,22,"بل قد أتيتم الى جبل صهيون والى مدينة الله الحي اورشليم السماوية والى ربوات هم محفل ملائكة"));
arasuperobject.biblemap.put("b58_12_23", new arasuperobject(58,12,23,"وكنيسة ابكار مكتوبين في السموات والى الله ديان الجميع والى ارواح ابرار مكمّلين"));
arasuperobject.biblemap.put("b58_12_24", new arasuperobject(58,12,24,"والى وسيط العهد الجديد يسوع والى دم رشّ يتكلم افضل من هابيل"));
arasuperobject.biblemap.put("b58_12_25", new arasuperobject(58,12,25,"انظروا ان لا تستعفوا من المتكلم. لانه ان كان اولئك لم ينجوا اذ استعفوا من المتكلم على الارض فبالأولى جدا لا ننجو نحن المرتدين عن الذي من السماء"));
arasuperobject.biblemap.put("b58_12_26", new arasuperobject(58,12,26,"الذي صوته زعزع الارض حينئذ واما الآن فقد وعد قائلا اني مرة ايضا ازلزل لا الارض فقط بل السماء ايضا"));
arasuperobject.biblemap.put("b58_12_27", new arasuperobject(58,12,27,"فقوله مرة ايضا يدل على تغيّر الاشياء المتزعزعة كمصنوعة لكي تبقى التي لا تتزعزع"));
arasuperobject.biblemap.put("b58_12_28", new arasuperobject(58,12,28,"لذلك ونحن قابلون ملكوتا لا يتزعزع ليكن عندنا شكر به نخدم الله خدمة مرضية بخشوع وتقوى"));
arasuperobject.biblemap.put("b58_12_29", new arasuperobject(58,12,29,"لان الهنا نار آكلة"));
arasuperobject.biblemap.put("b58_13_1", new arasuperobject(58,13,1,"لتثبت المحبة الاخوية"));
arasuperobject.biblemap.put("b58_13_2", new arasuperobject(58,13,2,"لا تنسوا اضافة الغرباء لان بها اضاف اناس ملائكة وهم لا يدرون"));
arasuperobject.biblemap.put("b58_13_3", new arasuperobject(58,13,3,"اذكروا المقيدين كانكم مقيدون معهم والمذلين كانكم انتم ايضا في الجسد"));
arasuperobject.biblemap.put("b58_13_4", new arasuperobject(58,13,4,"ليكن الزواج مكرما عند كل واحد والمضجع غير نجس. واما العاهرون والزناة فسيدينهم الله"));
arasuperobject.biblemap.put("b58_13_5", new arasuperobject(58,13,5,"لتكن سيرتكم خالية من محبة المال. كونوا مكتفين بما عندكم لانه قال لا اهملك ولا اتركك"));
arasuperobject.biblemap.put("b58_13_6", new arasuperobject(58,13,6,"حتى اننا نقول واثقين الرب معين لي فلا اخاف. ماذا يصنع بي انسان"));
arasuperobject.biblemap.put("b58_13_7", new arasuperobject(58,13,7,"اذكروا مرشديكم الذين كلموكم بكلمة الله. انظروا الى نهاية سيرتهم فتمثلوا بايمانهم"));
arasuperobject.biblemap.put("b58_13_8", new arasuperobject(58,13,8,"يسوع المسيح هو هو امسا واليوم والى الابد"));
arasuperobject.biblemap.put("b58_13_9", new arasuperobject(58,13,9,"لا تساقوا بتعاليم متنوعة وغريبة لانه حسن ان يثبّت القلب بالنعمة لا باطعمة لم ينتفع بها الذين تعاطوها"));
arasuperobject.biblemap.put("b58_13_10", new arasuperobject(58,13,10,"لنا مذبح لا سلطان للذين يخدمون المسكن ان يأكلوا منه"));
arasuperobject.biblemap.put("b58_13_11", new arasuperobject(58,13,11,"فان الحيوانات التي يدخل بدمها عن الخطية الى الاقداس بيد رئيس الكهنة تحرق اجسامها خارج المحلّة"));
arasuperobject.biblemap.put("b58_13_12", new arasuperobject(58,13,12,"لذلك يسوع ايضا لكي يقدس الشعب بدم نفسه تألم خارج الباب"));
arasuperobject.biblemap.put("b58_13_13", new arasuperobject(58,13,13,"فلنخرج اذا اليه خارج المحلّة حاملين عاره"));
arasuperobject.biblemap.put("b58_13_14", new arasuperobject(58,13,14,"لان ليس لنا هنا مدينة باقية لكننا نطلب العتيدة"));
arasuperobject.biblemap.put("b58_13_15", new arasuperobject(58,13,15,"فلنقدم به في كل حين للّه ذبيحة التسبيح اي ثمر شفاه معترفة باسمه"));
arasuperobject.biblemap.put("b58_13_16", new arasuperobject(58,13,16,"ولكن لا تنسوا فعل الخير والتوزيع لانه بذبائح مثل هذه يسرّ الله"));
arasuperobject.biblemap.put("b58_13_17", new arasuperobject(58,13,17,"اطيعوا مرشديكم واخضعوا لانهم يسهرون لاجل نفوسكم كانهم سوف يعطون حسابا لكي يفعلوا ذلك بفرح لا آنين لان هذا غير نافع لكم"));
arasuperobject.biblemap.put("b58_13_18", new arasuperobject(58,13,18,"صلّوا لاجلنا. لاننا نثق ان لنا ضمير صالح راغبين ان نتصرف حسنا في كل شيء"));
arasuperobject.biblemap.put("b58_13_19", new arasuperobject(58,13,19,"ولكن اطلب اكثر ان تفعلوا هذا لكي اردّ اليكم باكثر سرعة"));
arasuperobject.biblemap.put("b58_13_20", new arasuperobject(58,13,20,"واله السلام الذي اقام من الاموات راعي الخراف العظيم ربنا يسوع بدم العهد الابدي"));
arasuperobject.biblemap.put("b58_13_21", new arasuperobject(58,13,21,"ليكمّلكم في كل عمل صالح لتصنعوا مشيئته عاملا فيكم ما يرضي امامه بيسوع المسيح الذي له المجد الى ابد الآبدين. آمين"));
arasuperobject.biblemap.put("b58_13_22", new arasuperobject(58,13,22,"واطلب اليكم ايها الاخوة ان تحتملوا كلمة الوعظ لاني بكلمات قليلة كتبت اليكم"));
arasuperobject.biblemap.put("b58_13_23", new arasuperobject(58,13,23,"اعلموا انه قد أطلق الاخ تيموثاوس الذي معه سوف اراكم ان أتى سريعا"));
arasuperobject.biblemap.put("b58_13_24", new arasuperobject(58,13,24,"سلموا على جميع مرشديكم وجميع القديسين. يسلم عليكم الذين من ايطاليا"));
arasuperobject.biblemap.put("b58_13_25", new arasuperobject(58,13,25,"النعمة مع جميعكم. آمين. الى العبرانيين كتبت من ايطاليا على يد تيموثاوس"));

